function Timp(props) {
  return (
      <><h2>
          
    </h2>
      Timp trecut: {props.DigitFour % 10}
      {props.DigitThere % 10}
      {props.DigitTwo % 10}
      {props.DigitOne % 10}
    </>
  );
}

let counter = 0;

export default Timp;
